import { Map } from 'ol';

//interfaces
export interface IMapProps {

}

export interface IMapSidebarProps extends IMapState {

}

export interface IMapState {
    map: Map | null,
}

export interface ISidebarProps {
    id: string,
    collapsed?: boolean,
    position?: TSidebarPosition,
    selected?: string | undefined,
    closeIcon?: TIcons,
    onClose?: () => void,
    doOpen?: (id: string | undefined) => void,
    children?: any,
    anchor?: string,
}

export interface ITabProps {
    id: string,
    header: string,
    faIcon: TIcons,
    anchor?: TTabPosition,
    disabled?: boolean,
    onClose?: () => void,
    closeIcon?: TIcons,
    position?: TSidebarPosition,
    active?: boolean,
    children?: any,
}

export interface IToggleProps {
    id:string,
    isOn: boolean,
    isOnColor: string,
    handleToggle: () => void,
    layerName?:string
}

//types
export type TSidebarPosition = 'left' | 'right';
export type TTabPosition = 'top' | 'bottom';
export type TIcons = string | JSX.Element | Element;

//enums

export enum Projections {
    EPSG_4326 = 'EPSG:4326',
    EPSG_3857 = 'EPSG:3857'
}
